  <title>Sortable Bootstrap Table</title>
  <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0-alpha1/dist/css/bootstrap.min.css" rel="stylesheet" integrity="sha384-KyZXEAg3QhqLMpG8r+Knujsl7/1L_dstPtjt+/k9H6tGuIoM9vAsT0UT5RZjr8zPt" crossorigin="anonymous">
</head>
<body>
  <table class="table table-striped">
    <thead>
      <tr>
        <th onclick="sortTable(0)">Name</th>
        <th onclick="sortTable(1)">Age</th>
      </tr>
    </thead>
    <tbody id="myTable">
      <tr>
        <td>Alice</td>
        <td>25</td>
      </tr>
      <tr>
        <td>Bob</td>
        <td>30</td>
      </tr>
      <tr>
        <td>Charlie</td>
        <td>22</td>
      </tr>
      <tr>
        <td>David</td>
        <td>28</td>
      </tr>
    </tbody>
  </table>

  <script>
    function sortTable(n) {
      let table, rows, switching, i, x, y, shouldSwitch, dir, switchcount = 0;
      table = document.getElementById("myTable");
      switching = true;
      dir = "asc";
      rows = table.rows;
      for (i = 1; i < rows.length - 1; i++) {
        shouldSwitch = false;
        x = rows[i].getElementsByTagName("TD")[n];
        y = rows[i + 1].getElementsByTagName("TD")[n];
        if (dir == "asc") {
          if (x.innerHTML.toLowerCase() > y.innerHTML.toLowerCase()) {
            shouldSwitch = true;
          }
        } else if (dir == "desc") {
          if (x.innerHTML.toLowerCase() < y.innerHTML.toLowerCase()) {
            shouldSwitch = true;
          }
        }
        if (shouldSwitch) {
          rows[i].parentNode.insertBefore(rows[i + 1], rows[i]);
          switchcount ++;
        }
      }
      if (switchcount == 0 && dir == "asc") {
        dir = "desc";
        switching = true;
      }
      for (i = 0; i < rows.length; i++) {
        rows[i].onclick = function() {
          this.parentNode.insertBefore(this, rows[0]);
        }
      }
    }
  </script>
</body>
</html>
```

In this example, the `sortTable` function sorts the table rows based on the clicked header. The `dir` variable determines the sorting direction (ascending or descending). The `switchcount` variable keeps track of the number of switches made during the sorting process. If no switches are made, the direction is reversed.

The table rows are also made clickable so that they can be moved to the top of the table. This is done by adding an `onclick` event listener to each row.

