function mergeArrays(arr1, arr2) {
  const set = new Set();

  // Iterate through both arrays and add unique objects to the set
  arr1.concat(arr2).forEach(obj => {
    const key = JSON.stringify([obj.stepId, obj.fieldId]);
    if (!set.has(key)) {
      set.add(key, obj);
