1. Create a `Dialogue` class to represent a dialogue with multiple choices. This class should have the following fields:
   - `String text`: The text of the dialogue.
   - `List<String> choices`: A list of choices for the player to select from.
   - `int correctChoiceIndex`: The index of the correct choice (if there is a correct choice).
   - `String response`: The response to the player's choice.

