In C, the `malloc`, `calloc`, and `realloc` functions are used for dynamic memory allocation. Here's a simple implementation of these functions in C:

1. malloc():

```c
#include <stdio.h>
#include <stdlib.h>

void *my_malloc(size_t size) {
    void *ptr = malloc(size);
    if (ptr == NULL) {
        printf("Memory allocation failed\n");
    }
    return ptr;
}
```

2. calloc():

```c
#include <stdio.h>
#include <stdlib.h>

void *my_calloc(size_t num, size_t size) {
    void *ptr = calloc(num, size);
    if (ptr == NULL) {
        printf("Memory allocation failed\n");
    }
    return ptr;
}
```

3. realloc():

```c
#include <stdio.h>
#include <stdlib.h>

void *my_realloc(void *ptr, size_t size) {
    void *new_ptr = realloc(ptr, size);
    if (new_ptr == NULL) {
        printf("Memory reallocation failed\n");
    }
    return new_ptr;
}
```

These functions are wrappers around the standard library functions `malloc`, `calloc`, and `realloc`. They check if the memory allocation was successful and print an error message if it wasn't.

Remember to include the `<stdlib.h>` header file to use these functions. Also, these functions return a void pointer, so you should cast it to the appropriate type when using it.

Here's an example of using these functions:

```c
int main() {
    int *arr = my_malloc(10 * sizeof(int));
    if (arr != NULL) {
        // Use the allocated memory
        for (int i = 0; i < 10; i++) {
            arr[i] = i * i;
        }
        // Free the memory
        free(arr);
    }

    int *arr2 = my_calloc(5, sizeof(int));
    if (arr2 != NULL) {
        // Use the allocated memory
        for (int i = 0; i < 5; i++) {
            arr2[i] = i * i;
        }
        // Free the memory
        free(arr2);
    }

    int *arr3 = my_malloc(15 * sizeof(int));
    if (arr3 != NULL) {
        // Copy the elements from arr to arr3
        for (int i = 0; i < 10; i++) {
            arr3[i] = arr[i];
        }
        // Free the old memory
        free(arr);
        // Resize the new memory
        arr3 = my_realloc(arr3, 20 * sizeof(int));
        if (arr3 != NULL) {
            // Use the resized memory
            for (int i = 10; i < 20; i++) {
                arr3[i] = i * i;
            }
        }
        // Free the memory
        free(arr3);
    }

    return 0;
}
```

This example demonstrates the usage of `my_malloc`, `my_calloc`, and `my_realloc` functions. It allocates memory for three arrays, copies elements, resizes the memory, and frees the memory when it's no longer needed.

